import {withAmp} from 'next/amp'
import React from 'react'
import Head from 'next/head'

const experiment = (props) => (

    <div>
        <amp-video autoplay loop noaudio width="320"  height="568" layout="responsive"><source src="https://www.tesla.com/ns_videos/hp_2019/accessories-hero-mobile.mp4" type="video/mp4"/></amp-video>
    </div>
)

export default withAmp(experiment, {hybrid:true})
